import React from "react";

const Rank = (props) => {
  return (
    <div>
      <div className="white f3">{`${this.state.user.name}, your current entry count is...`}</div>
      <div className="white f1">{`${this.state.user.entries}`}</div>
    </div>
  );
};

export default Rank;
